import React, { useState } from "react";
import { Grid, TextField } from "@mui/material";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";

const Day = () => {
  const onDragEnd = (result) => {
    
  };

  return (
    <>
        <button
            style={{
                position: 'absolute',
                left: 0,
                top: 0
            }}
        >
            Button
        </button>
        <DragDropContext onDragEnd={onDragEnd}>
            <Grid container gap={8} marginTop={'1em'} justifyContent={'center'}>
                <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'} minHeight={550}>
                    <Droppable droppableId="droppable1">
                        {(provided) => (
                        <ul
                            {...provided.droppableProps}
                            ref={provided.innerRef}
                            style={{
                                listStyleType: 'none',
                                padding: '8px',
                                margin: '8px',
                                minHeight:'200px'
                            }}
                        >
                            {provided.placeholder}
                        </ul>
                        )}
                    </Droppable>
                </Grid>
                <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                    <Droppable droppableId="droppable2">
                        {(provided) => (
                        <ul
                            {...provided.droppableProps}
                            ref={provided.innerRef}
                            style={{
                                listStyleType: 'none',
                                padding: '8px',
                                margin: '8px',
                                minHeight:'200px'
                            }}
                        >
                            {provided.placeholder}
                        </ul>
                        )}
                    </Droppable>
                </Grid>
            <Grid item xs={3.33} border={[1, "dashed"]} borderRadius={'2em'}>
                These
            </Grid>
        </Grid>
    </DragDropContext>
</>
  );
}

export default Day;
